import React,{Component} from "react";
import PropTypes from 'prop-types'
import "../css/public.css";
import UngroupedItem from "./UngroupedItem";

class UngroupedList extends Component{
    render() {
        const {list,toggleDoneItem,deleteList} = this.props;
        return(
            <div>
                <span>未分组任务:</span>
                <ul>
                    {
                        list.map( item => {
                            return (
                                <UngroupedItem
                                    key={item.id}
                                    {...item}
                                    toggleDoneItem = {toggleDoneItem}
                                    deleteList = {deleteList}
                                />
                            );
                        })
                    }
                </ul>
            </div>
        );
    }
}

UngroupedList.propTypesr = {
    list:PropTypes.array.isRequired,
    toggleDoneItem:PropTypes.func
}
export default UngroupedList;
